import React from "react";

function WelcomePage() {
  return (
    <div>
      <h1>Welcome to the Experiment</h1>
      <p>
        In this experiment, you will identify identifiers written in camelCase
        or kebab-case. Follow the instructions carefully.
      </p>
      <button onClick={() => (window.location.href = "/form")}>
        Start Experiment
      </button>
    </div>
  );
}

export default WelcomePage;
